;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/p2</span>","value":"#'user/p2"}
;; <=

;; **
;;; And here we compose them to form a single plot. The axes and plot range are taken from the first plot given to compose.
;; **

;; @@
(compose p p2)
